import React, { createContext, useContext, useState, useRef, useCallback, useEffect } from 'react';

const WebGazerContext = createContext();

export const WebGazerProvider = ({ children }) => {
  const [webgazerReady, setWebgazerReady] = useState(false);
  const webgazerInstance = useRef(null);
  const [calibrating, setCalibrating] = useState(false);
  const [calibrationPoints, setCalibrationPoints] = useState([]);
  const [clickCounts, setClickCounts] = useState(Array(15).fill(0));

  const initializeWebGazer = useCallback(async () => {
    try {
      await window.webgazer.setRegression('ridge').setTracker('clmtrackr').begin();
      webgazerInstance.current = window.webgazer;
      setWebgazerReady(true);

      // ตั้งค่าให้ซ่อน UI ของ WebGazer
      window.webgazer.showVideo(true);
      window.webgazer.showFaceOverlay(false);
      window.webgazer.showFaceFeedbackBox(true);

      // ซ่อนผ่านการใช้ CSS หากยังไม่ถูกซ่อน
      document.getElementById('webgazerVideoFeed').style.display = 'none';
      document.getElementById('webgazerFaceOverlay').style.display = 'none';
      document.getElementById('webgazerFaceFeedbackBox').style.display = 'none';

    } catch (error) {
      console.error('Failed to initialize webgazer:', error);
    }
  }, []);

  const startCalibration = useCallback(() => {
    if (webgazerInstance.current) {
      webgazerInstance.current.clearData();
      webgazerInstance.current.showFaceOverlay(true);
      setCalibrating(true);
      setCalibrationPoints(generateCalibrationPoints());
      setClickCounts(Array(15).fill(0));
    }
  }, [webgazerInstance]);

  const stopCalibration = useCallback(() => {
    if (webgazerInstance.current) {
      webgazerInstance.current.showFaceOverlay(false);
    }
    setCalibrating(false);
    setCalibrationPoints([]);
  }, [webgazerInstance]);

  const generateCalibrationPoints = () => {
    const positions = [
      { x: 12, y: 25 }, { x: 12, y: 48 }, { x: 12, y: 69 }, { x: 12, y: 92 }, 
      { x: 35, y: 45 }, { x: 61, y: 45 }, { x: 87, y: 45 },
      { x: 35, y: 67 }, { x: 61, y: 67 }, { x: 87, y: 67 },
      { x: 35, y: 86 }, { x: 61, y: 86 }, { x: 87, y: 86 }, 
      { x: 89, y: 28 }, { x: 95, y: 7 }
    ];
    return positions.map(pos => ({ x: `${pos.x}%`, y: `${pos.y}%`, color: 'red' }));
  };

  const handleCalibrationClick = useCallback((index, e) => {
    if (webgazerInstance.current) {
      const { clientX, clientY } = e;
      webgazerInstance.current.recordScreenPosition(clientX, clientY, 'click');
      const newClickCounts = [...clickCounts];
      newClickCounts[index] += 1;
      setClickCounts(newClickCounts);

      if (newClickCounts[index] >= 3) {
        const newCalibrationPoints = [...calibrationPoints];
        newCalibrationPoints[index].color = 'yellow';
        setCalibrationPoints(newCalibrationPoints);
      }
    }
  }, [clickCounts, calibrationPoints, webgazerInstance]);

  const handleGaze = useCallback((data) => {
    if (data == null || calibrating) return;

    const { x, y } = data;
    const element = document.elementFromPoint(x, y);

    if (element) {
      const interactiveElement = element.closest('button, a, [role="button"]');

      if (interactiveElement) {
        interactiveElement.classList.add('gazing');
        setTimeout(() => {
          interactiveElement.click();
          interactiveElement.classList.remove('gazing');
        }, 1000);
      }
    }
  }, [calibrating]);

  useEffect(() => {
    initializeWebGazer();

    return () => {
      if (webgazerInstance.current && typeof webgazerInstance.current.end === 'function') {
        try {
          webgazerInstance.current.end();
        } catch (error) {
          console.error('Error while ending webgazer:', error);
        }
      }
    };
  }, [initializeWebGazer]);

  useEffect(() => {
    if (webgazerReady && webgazerInstance.current) {
      const currentWebgazer = webgazerInstance.current;

      const gazeListener = (data, elapsedTime) => {
        if (data == null) return;
        handleGaze(data);
      };

      currentWebgazer.setGazeListener(gazeListener);

      return () => {
        if (webgazerReady && currentWebgazer) {
          currentWebgazer.clearGazeListener();
        }
      };
    }
  }, [handleGaze, webgazerReady, webgazerInstance]);

  return (
    <WebGazerContext.Provider value={{ webgazerReady, webgazerInstance, calibrating, calibrationPoints, startCalibration, stopCalibration, handleCalibrationClick }}>
      {children}
    </WebGazerContext.Provider>
  );
};

export const useWebGazerContext = () => {
  const context = useContext(WebGazerContext);
  if (!context) {
    throw new Error('useWebGazerContext must be used within a WebGazerProvider');
  }
  return context;
};
